interface IProps {
    Component: any,
    pageProps: any
}

const App: React.FC<IProps> = ({ Component, pageProps }) => {
    return (
        <div>
            <Head>
                <title>Antd Version 4.x - Typescript Example</title>
                <meta name="viewport" content="width=device-width, initial-scale=1" />
            </Head>
